import React from 'react'

export default function Datatable({band}){
    const columns = band[0] && Object.keys(band)

    return <table cellPadding={0} cellSpacing={0}>
        <thead>
        <tr>{band[0] && columns.map(heading => <th>{heading}</th>)}</tr>
        </thead>
        <tbody>
    {band.map(row => <tr>
        {columns.map(column => <td>{row[column]}</td>)}
    </tr>)}
        </tbody>

    </table>
}
